import React from 'react';
// import { useState } from 'react';
// import PropTypes from 'prop-types'

 export default function LoginAuthPage(props){

    v


    return(
        <>
            <div className='login-auth-detail-container' style={{display:props.disp}}>
                <div className='login-auth-container-header'>
                    Login
                <div className='login-auth-container-close-button' onClick={closeAuthPage()}>
                    <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" fill="currentColor"><path d="M11.9997 10.5865L16.9495 5.63672L18.3637 7.05093L13.4139 12.0007L18.3637 16.9504L16.9495 18.3646L11.9997 13.4149L7.04996 18.3646L5.63574 16.9504L10.5855 12.0007L5.63574 7.05093L7.04996 5.63672L11.9997 10.5865Z"></path></svg>
                </div>
                </div>
                <div className='login-auth-container-body'>
                    <div className='login-auth-email-pass-container'>
                        <input type="text" placeholder='Email' className='login-auth-body-email'/>
                        <input type="password" placeholder='Password' className='login-auth-body-email'/>
                    </div>
                    <button className='login-auth-body-button'>LOGIN</button>
                </div>
                <div className='login-auth-container-signUp'>
                    Dont have an Account?&nbsp;&nbsp; <a href="/" style={{color:'white', textDecoration:'underline'}}>Sign Up</a>
                </div>
            </div>
        </>
        
    );
 }
